import React from "react";

export class ProductNames extends React.Component {
  render() {
    client
    .query({
      query: gql`
        query GetRates {
          rates(currency: "USD") {
            currency
          }
        }
      `
    })
    .then(result => console.log(result));

    return data.category.products.map(({ name, inStock }) => (
      <div key={name}>
        <p>

          {name}: {inStock.toString()}
        </p>
      </div>
    ));
  }
}
